import { Component } from "react";
import { Col } from "react-bootstrap";
import "../Components/Netflix.css";

class Movie extends Component {
  render() {
    return (
      <Row>
        <Col md={2}>
          <img className="movie-cover" src="./assets/media/media0.jpg" alt="#" />
        </Col>
      </Row>
    );
  }
}

export default Movie;
